import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  font-family: Arial, sans-serif;
  font-size: 14px;

  margin-top: 10px;

  ul {
    li {
      display: flex;

      padding: 10px 10px;

      &:hover {
        background-color: #434c5b;
      }

      a {
        text-decoration: none;
        color: #eee;
      }
    }
  }
`;
